import React from 'react'
import s from './Dialogs.module.css'
import {NavLink} from "react-router-dom";

const NameDialog = (props) => {
    return (
        <div className={s.dialog + ' ' + s.active}>
            <NavLink className={navData => navData.isActive ? s.active : s.dialog}
                     to={'/dialogs/' + props.id}> {props.name}</NavLink>
        </div>
    )
}
const Message = (props) => {
    return (
        <div className={s.message_item}>{props.text}</div>
    )
}
const Dialogs = (props) => {

    let DialogData = [
        {id:1,name:'Mikee'},
        {id:2,name:'Denis'},
        {id:3,name:'Mikee'},
        {id:4,name:'Mikee'},
        {id:5,name:'Mikee'}
    ]
    let TextData = [
        {id:1,text:'acascascascsac'},
        {id:2,text:'acascascascsac'},
        {id:3,text:'acascascascsac'},
        {id:4,text:'acascascascsac'}
    ]
    let DialogMass = dialog.map(()=>{<NameDialog name={dialog.name} id={dialog.id}/>})
        
    return (
        <div className={s.container}>
            <div className={s.dialogs}>
                <div className={s.dialog_items}>

                    {DialogMass}

                </div>
            </div>
            <div className={s.messages}>
                <Message text={TextData[0].text}/>
                <Message text={TextData[1].text}/>
                <Message text={TextData[2].text}/>
                <Message text={TextData[3].text}/>


            </div>
        </div>
    )
}
export default Dialogs
